import SearchIcon from "../../assets/images/icon-search.svg";
import "./Main.css";

const Main = () => {
  return (
    <div id="main-container">
      <form>
        <input
          type="text"
          id="search-input"
          style={{
            backgroundImage: `url(${SearchIcon})`,
            backgroundRepeat: "no-repeat",
            backgroundPosition: " center 50%",
            paddingLeft: "14%",
          }}
        />
      </form>
    </div>
  );
};

export default Main;
